import React from "react";
import { Track } from "../../api/track/models/Track";
import { Box, Typography, List, ListItem, Divider, Paper } from "@mui/material";
import { PageList } from "../../types/PageList";
import { TrackListItem } from "./TrackListItem";

interface Props {
  tracks: PageList<Track> | undefined;
  onTrackDelete: (trackId: string) => void;
  onTrackUpdated: (track: Track) => void;
}

export const TrackList: React.FC<Props> = ({
  tracks,
  onTrackDelete,
  onTrackUpdated,
}) => {
  return (
    <Box
      sx={{
        width: "100%",
        maxWidth: 1200,
        margin: "0 auto",
        p: { xs: 2, md: 4 },
      }}
    >
      {/* –ó–∞–≥–æ–ª–æ–≤–æ–∫ */}
      <Typography
        variant="h3"
        gutterBottom
        sx={{
          fontWeight: 700,
          textAlign: "center",
          mb: 5,
          background: "linear-gradient(135deg, #667eea 0%, #764ba2 100%)",
          backgroundClip: "text",
          WebkitBackgroundClip: "text",
          WebkitTextFillColor: "transparent",
          letterSpacing: -0.5,
          fontSize: { xs: "2rem", md: "3rem" },
        }}
      >
        üé∂ My Tracks
      </Typography>

      {/* –°–ø–∏—Å–æ–∫ */}
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          gap: 2.5,
        }}
      >
        {tracks?.data.map((track, index) => (
          <Paper
            key={track.id}
            elevation={0}
            sx={{
              width: "100%",
              borderRadius: 3,
              overflow: "hidden",
              background: "#ffffff",
              border: "1px solid #f0f0f0",
              transition: "all 0.3s cubic-bezier(0.4, 0, 0.2, 1)",
              "&:hover": {
                transform: "translateY(-4px)",
                boxShadow: "0 12px 40px rgba(102, 126, 234, 0.15)",
                border: "1px solid #667eea",
                "& .track-content": {
                  background:
                    "linear-gradient(135deg, #f8f9ff 0%, #faf5ff 100%)",
                },
              },
            }}
          >
            <Box
              className="track-content"
              sx={{
                p: { xs: 2.5, md: 3 },
                transition: "background 0.3s ease",
              }}
            >
              <TrackListItem
                track={track}
                onDelete={onTrackDelete}
                onTrackUpdated={onTrackUpdated}
              />
            </Box>
          </Paper>
        ))}
      </Box>
    </Box>
  );
};
